Biography:
There are several artists named Tom Walker;

1. Tom Walker is an Scottish born, Manchester raised, multi-instrumentalist and vocalist signed to Sony’s Relentless Records. During 2016, he released the songs "Sun Goes Down", "Fly Away With Me", "Play dead" and "Just You And I (Acoustic)".

2. Tom Walker is a heavy metal guitarist, bassist and vocalist from Milton Keynes, UK. He self-released a single named 'Downhill Flight' in January 2008, including a B-side named 'Love is a Killing Thing'. <a href="https://www.last.fm/music/Tom+Walker">Read more on Last.fm</a>

There are more than one act called Meduza:

1. Meduza are an Italian production trio consisting of Luca de Gregorio, Mattia Vitale and Simone Giani. They are known for their 2019 breakthrough song "Piece of Your Heart" which was a collaboration with British production trio Goodboys. Meduza have created a melodic, yet energetic sound, set to be the climactic point in Ibiza's ever thriving tale of upfront musical taste making;

2. Meduza is a punk /rock band from Oslo, Norway. <a href="https://www.last.fm/music/Meduza">Read more on Last.fm</a>

There are various artists with this name, including: 
1) Offset is American rapper Kiari Kendrell Cephus (born 14 December 1991); 
2) Offset is one of the names used by British techno producer Luke Slater;  
3) Offset is an Italian ambient artist; 
4) Offset is French artist Philippe Juven; 
5) Offset is a French electro artist from Paris. 

1) Offset is American rapper Kiari Kendrell Cephus (born 14 December 1991). He rose to prominence as part of the hip hop group Migos, alongside Quavo and Takeoff. <a href="https://www.last.fm/music/Offset">Read more on Last.fm</a>

There are several artists artists using the name "Max";

1) "Max" is Max Schneider, signed to DCD2. He released Mug Shot and The Say Max - EP in 2014. Gibberish (feat. Hoodie Allen) was released in 2015. His song "Lights Down Low" peaked at #20 on the Hot 100 in 2018.

2)  "MAX", which is short for Musical Active eXperience, is a Japanese pop group. Original members Mina, Reina, Lina and Nana formed MAX from their original group ,SUPER MONKEY'S in 1995 and released their debut single in May of that year. <a href="https://www.last.fm/music/Max">Read more on Last.fm</a>

Laika Suns is a Latvian rock band formed in 2012 in Rīga, Latvia.

All members have years of recording and performing experience with bands as Mofo, The Sound Poets, and Tesa. In 2013, the band released their debut EP Nakts Karalis under the I Love You Records label.

Current members:

Arnis Račinskis - guitars, lead vocals;
Elvijs Pārpucis - guitars;
Kārlis Josts (The Sound Poets, Nesen) - bass, backing vocals;
Jānis Burmeisters (Tesa, Sonntags Legion, Amorālā Psihoze, Nesen) - drums. <a href="https://www.last.fm/music/Laika+Suns">Read more on Last.fm</a>
